import Weird from "./Weird";
import {useState} from "react";

const RegS=(props)=>{

   const {anime} = props;
   const {} = props.anime;



    return (
      <div>
        <p>Name:{anime.name}</p>
        <p>Skill:{anime.skill}</p>
        <p>Level:{anime.level}</p>
      </div>

       
      );
}
export default RegS;
